import React from 'react';
import video1 from "./../video/PexelsVideos2881.mp4";

function WebVid() {
    return (

        <ul className="bxslider">
            <li>
                <div className="bg-video">
                    <video playsinline='playsinline'  src={video1}></video>
                </div>
            </li>
        </ul>

    )
}

export default WebVid;
